%===========================================================================
function WriteOutput( fileIdentifier, Output )
numberOfOutputQuantities = length( Output );
if numberOfOutputQuantities > 0,
  for i=1:numberOfOutputQuantities,
    fprintf( fileIdentifier, ' %- 14.6E', Output(i) );
  end
  fprintf( fileIdentifier, '\n' );
end



%===========================================================================
function CloseOutputFilesAndTerminate
FileIdentifier = fopen('all');
fclose( FileIdentifier(1) );
fclose( FileIdentifier(2) );
fprintf( 1, '\n Output is in the files WhippleAlgebraic.i  (i=1,2)\n' );
fprintf( 1, ' The output quantities and associated files are listed in the file WhippleAlgebraic.dir\n\n' );
